const navBar = () => {
    return (
        <div className="container flex justify-between">
            <div className="logo-container">
                <i>encourag-er</i>
            </div>
            <div className="navbar-links">
                <a href="#"><li>link1</li></a>
                <a href="#"><li>link2</li></a>
                <a href="#"><li>link3</li></a>
                <a href="#"><li>link4</li></a>
            </div>
        </div>
    )
}

export default navBar;
